description:
Info

The main character, Endou Mamoru, is a very talented goalkeeper  and the grandson of one of the strongest goalkeepers in Japan, who died before he was born. He is of the Raimon Middle School ('Ramon Junior High School') Even though his skills are incredible his school lacks a real soccer club as the 6 other members don't appear very interested even in training. But as soon as a mysterious forward called Gouenji moves to Endou's town, the young goalkeeper sets out to find and recruit members for his soccer team. There are nearly 1000 playable characters with varying skills that will determine the success of the team.

